USE CS411;
DROP TABLE CourseSchedule;
CREATE TABLE CourseSchedule(
   CRN           VARCHAR(7) NOT NULL
  ,YearTerm      VARCHAR(11) NOT NULL
  ,instructor_id INTEGER  NOT NULL
  ,PRIMARY KEY(CRN,YearTerm,instructor_id)
,CONSTRAINT CourseSchedule_fk FOREIGN KEY (CRN) REFERENCES Courses(CRN),
  CONSTRAINT CourseSchedule_fk1 FOREIGN KEY (instructor_id) REFERENCES Instructors(ID)
);
SELECT COUNT(*) FROM CourseSchedule